import React from "react";
import CounterWrapFourItem from "./CounterWrapFourItem";

const CounterWrapFour = () => {
  return (
    <div className="counter-item-wrap-four">
      <ul className="list-wrap">
        <li>
          <CounterWrapFourItem
            amount={5}
            suffix="+"
            title={
              <>
                Years of <span>Experience</span>
              </>
            }
          />
        </li>

        <li>
          <CounterWrapFourItem
            amount={20}
            suffix="+"
            title={
              <>
                Projects <span>Completed</span>
              </>
            }
          />
        </li>

        <li>
          <CounterWrapFourItem
            amount={10}
            suffix="+"
            title={
              <>
                Happy <span>Clients</span>
              </>
            }
          />
        </li>
        <li>
          <CounterWrapFourItem
            amount={5}
            suffix="+"
            title={
              <>
                Technologies <span>Mastered</span>
              </>
            }
          />
        </li>
      </ul>
    </div>
  );
};

export default CounterWrapFour;
